import "./App.css";
import { UserProvider } from "./context/UserContext";
function App() {
  return (
    <>
      <div>
        <UserProvider>
          <div className="bg-gray-100 min-h-screen">
            <Home></Home>
          </div>
        </UserProvider>
      </div>
    </>
  );
}
export default App;
